import React from 'react';
import Thumbnail from 'react-webpage-thumbnail';

function Dashboard() {
    return (
        <div className = "dashboard-container">
            <h1>Dashboard</h1>
            <Thumbnail
  url="https://nodejs.org/en/download/"
  width={200}
  height={200}
  iframeHeight={1920}
  iframeWidth={1080}
/>
        </div>
    )
}

export default Dashboard;
